import React from 'react';
import { View, Text, StyleSheet, ScrollView } from 'react-native';

// Funktion, um zufällige Namen zu generieren

const Persons = () => {
    return (
        <View style={stylesContainers.container}>
            <View>
            <Text style={stylesContainers.welcomeText}>Personen</Text>
            </View>
            <ScrollView>
                {personsList.map((person, index) => (
                    <View style = {stylesContainers.viewPersonen}>
                        <View></View>
                        <View>
                        <Text key={index}>{person.firstName}</Text>
                        <Text key={index}>{person.lastName}</Text>
                        </View>

                    </View>
                ))}
            </ScrollView>
        </View>
    );
};

const stylesContainers = StyleSheet.create({
    container: {
        flexDirection: "column",
        justifyContent: 'center',
        alignItems: 'center',
        padding: 20,
    },
    title: {
        fontSize: 24,
        fontWeight: 'bold',
        marginBottom: 20,
    },
    viewPersonen: {
        borderWidth: 1,
        borderColor: 'lightgray',
        borderRadius: 5,
        paddingLeft: 10,
        paddingRight: 10,
        height: 200,
        width: 200,
        margin: 10
    },

    person: {
        fontSize: 18,
        marginVertical: 5,
    },
    welcomeText: {
        color: 'rgba(240,175,77,1)',
        fontWeight: "bold",
        fontSize: 50,
    },
});

export default Persons;
